import type { ESLint, Linter } from 'eslint';
import type {
  EslintResultVisitor,
  RuleVisitData,
} from './eslint-result-visitor';
import {
  ProcessedFileResult,
  ProcessedEslintRulesStats,
} from './processed-eslint-result.types';
import { createProcessedTotalsTracker } from '../stats/totals';
import { walkEslintResult } from './eslint-result.walk';

type ESLintResult = ESLint.LintResult;
type EslintMessage = Linter.LintMessage;

export function createProcessEslintResultVisitor(): EslintResultVisitor & {
  getResults(): ProcessedEslintRulesStats;
} {
  let results: ProcessedFileResult[] = [];
  let currentFile: ProcessedFileResult | null = null;
  const totalsTracker = createProcessedTotalsTracker();

  return {
    visitFile(fileResult: ESLintResult): void {
      let fileTimeMs = 0;
      if (fileResult.stats?.times?.passes?.[0]?.total) {
        fileTimeMs = fileResult.stats.times.passes[0].total;
      }

      currentFile = {
        filePath: fileResult.filePath,
        timeMs: fileTimeMs,
        errors: fileResult.errorCount,
        warnings: fileResult.warningCount,
        fixableErrors: fileResult.fixableErrorCount || 0,
        fixableWarnings: fileResult.fixableWarningCount || 0,
        rules: [],
      };

      results.push(currentFile);
      totalsTracker.trackFile(currentFile);
    },

    visitMessage(message: EslintMessage, fileResult: ESLintResult): void {
      return;
    },

    visitRule(ruleData: RuleVisitData, fileResult: ESLintResult): void {
      if (!currentFile) return;

      const { ruleId, messages, timeMs } = ruleData;
      const errors = messages.filter((msg) => msg.severity === 2).length;
      const warnings = messages.filter((msg) => msg.severity === 1).length;
      const fixable = messages.some((msg) => msg.fix);

      const ruleResult = {
        ruleId,
        timeMs,
        errors,
        warnings,
        fixable,
      };

      currentFile.rules.push(ruleResult);
      totalsTracker.trackRule(ruleResult);
    },

    getResults(): ProcessedEslintRulesStats {
      // Calculate total rules across all files
      const totalRules = results.reduce(
        (sum, file) => sum + file.rules.length,
        0
      );
      totalsTracker.setTotalRules(totalRules);

      const totals = totalsTracker.getTotals();

      return {
        ...totals,
        processedFileResults: [...results],
      };
    },
  };
}

export function processEslintResults(
  results: ESLintResult[]
): ProcessedEslintRulesStats {
  const visitor = createProcessEslintResultVisitor();
  walkEslintResult(results, visitor);

  return visitor.getResults();
}

import type { ESLint } from 'eslint';
import { EslintResultVisitor, RuleVisitData } from './eslint-result-visitor';
import { StopOnFalseWalkOptions } from './walk.types';

type ESLintResult = ESLint.LintResult;

export function walkEslintResult(
  parsedResults: ESLintResult[],
  visitor: EslintResultVisitor,
  options: StopOnFalseWalkOptions = {}
): void {
  const { stopOnFalse = false } = options;

  for (const fileResult of parsedResults) {
    if (visitor.visitFile) {
      const result = visitor.visitFile(fileResult);
      // early exit in files if stopOnFalse is true
      if (result === false && stopOnFalse) break;
    }

    const messages = fileResult.messages || [];
    for (const message of messages) {
      if (visitor.visitMessage) {
        const result = visitor.visitMessage(message, fileResult);
        // early exit in messages if stopOnFalse is true
        if (result === false && stopOnFalse) {
          return;
        }
      }
    }

    if (visitor.visitRule) {
      const ruleStatsMap: Record<string, { total?: number }> =
        fileResult.stats?.times?.passes?.[0]?.rules || {};
      const allRuleIds = new Set([
        ...messages.filter((msg) => msg.ruleId).map((msg) => msg.ruleId!),
        ...Object.keys(ruleStatsMap),
      ]);

      for (const ruleId of allRuleIds) {
        const stats = ruleStatsMap[ruleId];
        const ruleMessages = messages.filter((msg) => msg.ruleId === ruleId);

        const ruleData: RuleVisitData = {
          ruleId,
          messages: ruleMessages,
          timeMs: stats?.total || 0,
        };

        const result = visitor.visitRule(ruleData, fileResult);
        // early exit in rules if stopOnFalse is true
        if (result === false && stopOnFalse) {
          return;
        }
      }
    }
  }
}

