import { ProcessedEslintResultVisitor } from '../parse/processed-eslint-result-visitor';
import {
  ProcessedFileResult,
  ProcessedRuleResult,
} from '../parse/processed-eslint-result.types';
import { walkProcessedResults } from '../parse/processed-eslint-result.walk';
import {
  ProcessedEslintResultTotals,
  createProcessedTotalsTracker,
} from './totals';

export interface GroupedRuleResult {
  ruleId: string;
  timeMs: number;
  errors: number;
  warnings: number;
}

export interface RuleGroupingStats extends ProcessedEslintResultTotals {
  groupedRules: GroupedRuleResult[];
}

export function createGroupByRuleVisitor(): ProcessedEslintResultVisitor & {
  getResults(): RuleGroupingStats;
} {
  let ruleMap = new Map<string, Omit<GroupedRuleResult, 'ruleId'>>();
  const totalsTracker = createProcessedTotalsTracker();

  return {
    visitFile(fileResult: ProcessedFileResult): void {
      totalsTracker.trackFile(fileResult);
    },

    visitRule(ruleResult: ProcessedRuleResult): void {
      // initialize the rule map if it doesn't exist
      if (!ruleMap.has(ruleResult.ruleId)) {
        ruleMap.set(ruleResult.ruleId, {
          timeMs: 0,
          errors: 0,
          warnings: 0,
        });
      }

      const ruleStats = ruleMap.get(ruleResult.ruleId)!;
      ruleStats.timeMs += ruleResult.timeMs;
      ruleStats.errors += ruleResult.errors;
      ruleStats.warnings += ruleResult.warnings;

      totalsTracker.trackRule(ruleResult);
    },

    getResults(): RuleGroupingStats {
      const groupedRules: GroupedRuleResult[] = Array.from(
        ruleMap.entries()
      ).map(([ruleId, { timeMs, errors, warnings }]) => ({
        ruleId,
        timeMs,
        errors,
        warnings,
      }));

      totalsTracker.setTotalRules(groupedRules.length);

      const totals = totalsTracker.getTotals();

      return {
        ...totals,
        groupedRules,
      };
    },
  };
}

export function groupByRule(
  processedResults: ProcessedFileResult[]
): RuleGroupingStats {
  const visitor = createGroupByRuleVisitor();
  walkProcessedResults(processedResults, visitor);
  return visitor.getResults();
}

export interface GroupedFileResult {
  filePath: string;
  timeMs: number;
  errors: number;
  fixableErrors: number;
  warnings: number;
  fixableWarnings: number;
}

export interface FileGroupingStats extends EslintResultTotals {
  groupedFiles: GroupedFileResult[];
}

export function createGroupByFileAndRuleVisitor(): ProcessedEslintResultVisitor & {
  getResults(): FileGroupingStats;
} {
  let fileMap = new Map<string, Omit<GroupedFileResult, 'filePath'>>();
  const totalsTracker = createProcessedTotalsTracker();

  return {
    visitFile(fileResult: ProcessedFileResult): void {
      // initialize the file map if it doesn't exist
      if (!fileMap.has(fileResult.filePath)) {
        fileMap.set(fileResult.filePath, {
          timeMs: 0,
          errors: 0,
          fixableErrors: 0,
          warnings: 0,
          fixableWarnings: 0,
        });
      }

      const fileStats = fileMap.get(fileResult.filePath)!;
      fileStats.timeMs += fileResult.timeMs;
      fileStats.errors += fileResult.errors;
      fileStats.fixableErrors += fileResult.fixableErrors;
      fileStats.warnings += fileResult.warnings;
      fileStats.fixableWarnings += fileResult.fixableWarnings;

      totalsTracker.trackFile(fileResult);
    },

    visitRule(ruleResult: ProcessedRuleResult): void {
      totalsTracker.trackRule(ruleResult);
    },

    getResults(): FileGroupingStats {
      const groupedFiles: GroupedFileResult[] = Array.from(
        fileMap.entries()
      ).map(
        ([
          filePath,
          { timeMs, errors, fixableErrors, warnings, fixableWarnings },
        ]) => ({
          filePath,
          timeMs,
          errors,
          fixableErrors,
          warnings,
          fixableWarnings,
        })
      );

      const totals = totalsTracker.getTotals();

      return {
        ...totals,
        groupedFiles,
      };
    },
  };
}

export function groupByFileAndRule(
  processedResults: ProcessedFileResult[]
): RuleGroupingStats {
  const visitor = createGroupByRuleVisitor();
  walkProcessedResults(processedResults, visitor);
  return visitor.getResults();
}

import {
  ProcessedFileResult,
  ProcessedRuleResult,
} from '../parse/processed-eslint-result.types';

/**
 * Common totals interface that can be used across different visitors and grouping strategies
 */
export interface ProcessedEslintResultTotals {
  totalFiles: number;
  totalRules: number;
  totalTimeMs: number;
  totalErrors: number;
  totalWarnings: number;
  totalFileErrors: number;
  totalFileWarnings: number;
  totalFixableErrors: number;
  totalFixableWarnings: number;
}

/**
 * Creates a totals tracker using functional composition
 * Returns an object with methods that close over shared state
 */
export function createProcessedTotalsTracker() {
  let totals: ProcessedEslintResultTotals = {
    totalFiles: 0,
    totalRules: 0,
    totalTimeMs: 0,
    totalErrors: 0,
    totalWarnings: 0,
    totalFileErrors: 0,
    totalFileWarnings: 0,
    totalFixableErrors: 0,
    totalFixableWarnings: 0,
  };

  return {
    trackFile(fileResult: ProcessedFileResult): void {
      totals.totalTimeMs += fileResult.timeMs;
      totals.totalFiles += 1;
      totals.totalFileErrors += fileResult.errors;
      totals.totalFileWarnings += fileResult.warnings;
      totals.totalFixableErrors += fileResult.fixableErrors;
      totals.totalFixableWarnings += fileResult.fixableWarnings;
    },

    trackRule(ruleResult: ProcessedRuleResult): void {
      totals.totalErrors += ruleResult.errors;
      totals.totalWarnings += ruleResult.warnings;
    },

    setTotalRules(count: number): void {
      totals.totalRules = count;
    },

    getTotals(): ProcessedEslintResultTotals {
      return { ...totals };
    },
  };
}

